    apply_link: "https://oralfish.o18.click/c?o=20359135&m=1446&a=140329",
    desc: "<p>Demat accounts were introduced in India in 1996, before which shares and securities were physically issued and traded. The importance of opening a free Demat account is such that it allows the investors to hold their securities electronically in their Demat accounts. This makes the entire procedure of investing, holding, monitoring, and trading, faster, convenient, and cost-efficient.</p>\r\n\r\n<p><strong>Benefits of a Demat account</strong></p>\r\n\r\n<p><strong>\u200b\u200b\u200b\u200b\u200b\u200b\u200b</strong>These are some of the advantages of a Demat account:</p>\r\n\r\n<ol>\r\n\t<li>Lower risks</li>\r\n\t<li>Easy holding</li>\r\n\t<li>Odd lots</li>\r\n\t<li>Reduced costs</li>\r\n\t<li>Reduced time&nbsp;&nbsp; &nbsp;</li>\r\n</ol>\r\n\r\n<p>Lower risks:<br />\r\nPhysical securities are risky due to thefts, losses, or damages. In addition, bad deliveries or fake securities pose further risks. These risks are eliminated with the opening of a Demat account, which provides holders with the option of holding all their investments in electronic form..</p>\r\n\r\n<p>Easy holding:<br />\r\nMaintaining physical certificates is a tedious job. Moreover, keeping track of their performance is an added responsibility. Demat account holders can make it more convenient to hold and track all their investments through a single account.</p>\r\n\r\n<p>Odd lots:<br />\r\nWith physical certificates, buying and selling were possible only in the specified quantities. The convenience of dealing with odd lots or single security was also not available. Demat accounts eliminate this issue.</p>\r\n\r\n<p>Reduced costs:<br />\r\nPhysical certificates involved several additional costs, such as stamp duty, handling charges, and other such expenses. These extra expenses are eliminated with Demat accounts.</p>\r\n\r\n<p>Reduced time:<br />\r\nDue to the elimination of paperwork, the time required in completing a transaction gets reduced. The reduced time requirement enables the account holder to make more purchases and sales of security holdings in a shorter time and with greater efficiency.</p>\r\n\r\n<p>Demat accounts are simple, fuss-free and extremely lucrative. In today&rsquo;s day and age, they are a must for financial planning.</p>\r\n\r\n<p><strong>Features of Demat account</strong></p>\r\n\r\n<p><strong>\u200b\u200b\u200b\u200b\u200b\u200b\u200b</strong>Easy share transfers:<br />\r\nInvestors can transfer their holdings through a delivery instruction slip (DIS) or receipt instruction slip (RIS) for buying or selling shares. These slips allow users to provide all the details that are required for executing a transaction smoothly.</p>\r\n\r\n<p>Faster dematerialisation &amp; rematerialisation of securities:<br />\r\nDemat account holders can provide instructions to their depository participant (DP) to convert physical certificates into electronic form. Alternatively, electronic securities can also be reconverted to physical form, if required.</p>\r\n\r\n<p>Pledging facility to avail loan:<br />\r\nSeveral lenders provide loans against securities that are held in the Demat account of the borrowers. These holdings are used as collateral to avail loans by the account holders.</p>\r\n\r\n<p>Freezing Demat accounts:<br />\r\nDemat account holders can freeze their accounts for a certain period, if required. This option can be beneficial if one wants to prevent unexpected debit or credit into one&rsquo;s Demat account. The freezing option is also available for a specific quantity of securities held in the account.</p>\r\n\r\n<p>Multiple accessing options:<br />\r\nDemat accounts are operated electronically, which means these can be accessed using multiple modes. These accounts can be accessed through the Internet using a computer, smartphone, or other smart devices.</p>\r\n\r\n<p>SPEED E-Facility:<br />\r\nThe National Securities Depository Limited (NSDL) allows users to send instruction slips electronically instead of physically submitting the slip to the DP. This makes the procedure more convenient and less time-consuming.</p>\r\n\r\n<p>Corporate benefits &amp; actions:<br />\r\nIf the companies offer dividends, refunds, or interest to their investors, these benefits are automatically available to the Demat account holders. In addition, corporate actions like bonus issues, right shares, or stock splits are automatically updated in the Demat account of all the shareholders.</p>",
