    desc: "<p>\u200b\u200b\u200b\u200b\u200b\u200b\u200b</p>\r\n\r\n<p><strong>Benefits and Features</strong></p>\r\n\r\n<ul>\r\n\t<li>Free Equity Delivery trading.</li>\r\n\t<li>Zero commission direct mutual funds.</li>\r\n\t<li>Maximum brokerage&nbsp;charged per trade is&nbsp;Rs 15.</li>\r\n\t<li>Zero maintenance charges.</li>\r\n\t<li>Fully digital account opening.</li>\r\n\t<li>Feature to switch external regular mutual fund to direct mutual fund.</li>\r\n</ul>\r\n\r\n<p><strong>Features &amp; Benefits of Opening a Demat Account</strong><br />\r\nInvestors who opt to open a Demat account can enjoy several benefits. Here are some of the most common benefits:</p>\r\n\r\n<p>Demat accounts eliminate the risk of damage, misplacement, forgery or theft of physical shares.<br />\r\nThe electronic system is also considerably simpler and can easily do seamless transactions in much less time.<br />\r\nYou can easily merge your bank accounts with Demat accounts for the facilitation of electronic fund transfer.<br />\r\nIf you have registered for a net banking facility, you can access your Demat account in a remote location as well.<br />\r\nFacilities offered by Demat Account</p>\r\n\r\n<p><strong>Here are Some Facilities That You Can Avail Through Demat Account</strong><br />\r\nWith the help of Delivery Instruction Slip, you can easily transfer your shares to another individual in a hassle-free manner.<br />\r\nYou can also avail of loan facilities from financial institutions against the security of shares kept in your Demat Account.<br />\r\nAutomatic updation of benefits associated with the shares including dividend, refunds, interest, stock split, rights issue, bonus shares, etc. gets automatically updated in this Demat account, you can thus easily avail it.<br />\r\nIf you hold a specific quantity of shares or other investments, you can freeze your Demat account for a certain period of time to prevent any unwanted transactions.<br />\r\nYou can access your Demat account using a desktop, laptop or smartphone from anywhere around the world.</p>\r\n\r\n<p><strong>Eligibility Criteria to Open a Demat Account</strong><br />\r\nYou can open a Demat account if you fulfill the eligibility criteria mentioned below:</p>\r\n\r\n<p>Any residential or non-residential Indian can open a Demat account through a depository participant.<br />\r\nA Demat account can also be opened in the name of a minor, provided a legal guardian monitors it.<br />\r\nDemat accounts can also be opened jointly with a maximum of three account holders, including the main account holder.</p>\r\n\r\n<p><strong>Documents Required to Open a Demat Account</strong><br />\r\nBefore providing the required documents, you should ensure that the papers are valid as of the submission date and that they haven&rsquo;t crossed the expiry date. Here is an important list of documents that you require to open a Demat account:</p>\r\n\r\n<p>Proof of Income: ITR acknowledgment slip submitted to Income Tax Department, Salary Slip or Form 16, statement of Demat account holdings with eligible depository participant, latest bank statement of previous six months &ndash; all self-attested.<br />\r\nProof of Identity: PAN Card, aadhaar card, voter ID card, driving license, passport, identity card issued by central or state government, public financial institutions, bar council, and other professional bodies.<br />\r\nProof of Address: Passport, voter&rsquo;s identity card, ration card, driving license, utility bills such as telephone or electricity bill, bank passbook, etc.<br />\r\nA passport-sized photograph.</p>\r\n\r\n<p><strong>Steps to Open a Demat account on Paytm Money</strong><br />\r\nDownload Paytm Money App<br />\r\nAdd Pan Card details and submit successfully.<br />\r\nNow submit an address proof for which you have to add Aadhar Card details.<br />\r\nSubmit your bank details, for adding and withdrawing funds from the Demat account.<br />\r\nGive an e-signature for AOF (account opening form) and you are done.<br />\r\nAfter submitting all these necessary details, Paytm Money&rsquo;s KYC team will take care of further proceedings to open a Demat account.</p>\r\n\r\n<p>Once the KYC process is done and your Demat account is in place, you can officially start investing in equities.</p>\r\n\r\n<ul>\r\n</ul>",
